import React, { useState } from 'react'
import { Signin, getdata } from './apiCall/api'
import { useDispatch } from 'react-redux'
import { dataRemove } from './Slice'

function SignUp() {
    const [username, setusername] = useState('')
    const [email, setemail] = useState('')
    const [age, setage] = useState(0)
    const [address, setaddress] = useState('')
    const formdata = new FormData()
    formdata.append('username',username)
    formdata.append('email',email)
    formdata.append('age',age)
    formdata.append('address',address)
    const dispatch =useDispatch()
    
    const disp = (e) => {
        e.preventDefault()
        // console.log('formdata',formdata);
        // console.log(Name);
        // console.log(email);
        // console.log(password);

        console.log(username,email,age,address);
        Signin({username,email,age,address})

    }
    const gettdata=()=>{
getdata(dispatch)

    }
    const removedata=()=>{
      dispatch(dataRemove())
    }
  return (
    <div>
       <form onSubmit={disp} encType='multipart/form-data'>
                <input type="text" placeholder='username' value={username} onChange={(e)=>setusername(e.target.value)}/>
                <input type="text" placeholder='email' value={email} onChange={(e)=>setemail(e.target.value)}/>
                <input type="number" placeholder='age' value={age} onChange={(e)=>setage(e.target.value)}/>
                <input type="text" placeholder='address' value={address} onChange={(e)=>setaddress(e.target.value)}/>
                <input type="submit" />
                
            </form>

            <button on onClick={gettdata}>click gett</button>
            <button on onClick={removedata}>click gett</button>

    </div>
  )
}

export default SignUp
